import React, { useState } from 'react';
import { Redirect, Switch, Route } from 'react-router'
import { Layout, Breadcrumb } from 'antd';
import { MenuUnfoldOutlined, MenuFoldOutlined, } from '@ant-design/icons';

import 'antd/dist/antd.css';
import './pagelayout.css';
import Sidebar from './Sidebar/Sidebar';
import Home from '../Home/Home';
import Testpage1 from '../TestPage/Testpage1';
import Line1 from '../Line1/Line1';
//import logo from '../../assets/logo.png'

// import Home from '../../pages/Home/Home';
// import TestApi from '../../pages/TestPage/TestApi';
// import DataVisualAlfaLava from '../../pages/DataVisualize/AlfaLava/DataVisualAlfaLava'
// import DataVisualTritiaux from '../../pages/DataVisualize/Tirtiaux/DataVisualTritiaux'
// import DataVisualOiltek from '../../pages/DataVisualize/Oiltek/DataVisualOiltek';
// import SiderBarMenu from '../SiderBarMenu/SiderBarMenu';
// import AlfaLavalReport from '../../pages/DailyReport/AlfaLavalReport/AlfaLavalReport';
// import TirtiauxReport from '../../pages/DailyReport/TirtiauxReport/TirtiauxReport';
// import NotificationSetting from '../../pages/Notification/NotificationSetting';
// import AlfaRealTime from '../../pages/RealtimeData/AlfaRealTime';
// import TirtiauxRealTime from '../../pages/RealtimeData/TirtiauxRealTime';
// import PolymerC3RealTime from '../../pages/RealtimeData/PolymerC3RealTime';
// import C3Report from '../../pages/DailyReport/Line1/C3Report';



const { Header, Content, Footer, Sider } = Layout;

const PageSider = () => {
  console.log('again')

  const [collapsed, setcollapsed] = useState(false)

  const toggle = () => {
    setcollapsed(!collapsed)
  };

  return (
    <Layout style={{ minHeight: '100vh' }}>
      <Sider collapsedWidth={60} trigger={null} collapsible collapsed={collapsed}>
        <div className="logo" >
          {/* <img src={logo} alt='Company logo'></img> */}
        </div>
        <Sidebar />
      </Sider>
      <Layout className="site-layout">
        <Header className="site-layout-background" style={{ padding: 0 }}>
          {React.createElement(collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
            className: 'trigger',
            onClick: toggle,
          })}

          {/* <img src={logo} alt='Company logo'></img> */}
        </Header>
        <Content style={{ margin: '0 16px' }}>



          <div style={{ padding: 24, minHeight: 360 }}>
            <Switch>
              <Redirect from='/' exact to='/Home' />
              <Route path='/Home' component={Home} />
              <Route path='/Line1' component={Line1} />
              <Route path='/Testpage1' component={Testpage1} />
              {/* <Route path='/DataVisualAlfaLava' component={DataVisualAlfaLava} />
              <Route path='/DataVisualTritiaux' component={DataVisualTritiaux} />
              <Route path='/DataVisualOiltek' component={DataVisualOiltek} />
              <Route path='/TestApi' component={TestApi} />
              <Route path='/AlfaLavalReport' component={AlfaLavalReport} />
              <Route path='/TirtiauxReport' component={TirtiauxReport} />
              <Route path='/C3Report' component={C3Report} />
              <Route path='/PolymerC3RealTime' component={PolymerC3RealTime} />
              <Route path='/AlfaRealTime' component={AlfaRealTime} />
              <Route path='/NotificationSetting' component={NotificationSetting} />
              <Route path='/TirtiauxRealTime' component={TirtiauxRealTime} /> */}
              {/* <Route component={NotFound} /> TestApi*/}
            </Switch>
          </div>

        </Content>
        <Footer style={{ textAlign: 'center' }}>IOT Control Solution Sdn. Bhd.</Footer>
      </Layout>
    </Layout>
  )
}

export default PageSider
